import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./index.css";
import CartProvider from "./components/store/CartProvider";
import { BrowserRouter as Router } from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
    <Router></Router>
    <CartProvider>
      <App />
    </CartProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
